import React from 'react';

function Login() {
  return (
    <div className="App">
    <header className="App-header">
      <p>
        Edit <code>src/pages/TestPage1.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </header>
  </div>
  );
}

export default Login;
